import React from 'react';
import Info from './components/info';
import Weather from './components/weather';
import Form from './components/form';

class App extends React.Component {
  render() {
    return (
      <div>
        <Info />
        <Form />
        <Weather />
      </div>
    );
  }
}

export default App;
